import { Component, OnInit } from '@angular/core';
import { AdminService } from '../admin.service';
import { NzMessageService } from 'ng-zorro-antd/message';
import { DatePipe } from '@angular/common';

export class Tds
{
  parentId: number = 0;
  name: string ='';
  email: string ='';
  contact: string ='';
  city: string ='';
  tds: number = 0;
  pan: string = '';
}

@Component({
  selector: 'app-tds',
  templateUrl: './tds.component.html',
  styleUrls: ['./tds.component.css']
})
export class TdsComponent implements OnInit {

  constructor(private adminService: AdminService, private msg: NzMessageService) { }

  tds: Tds[] = [];

  loading = false;

  ngOnInit(): void {

  }

date = null;

onChange()
{
  if(this.date == null)
  {

  }
  else
  {
    this.tdsDetails();
  }
}

  tdsDetails()
  {
    var datePipe = new DatePipe('en-US');
    let month = datePipe.transform(this.date, 'yyyy-MM-dd');
    var formData = new FormData();
    formData.set("month",month+"");

    this.loading=true;
    this.adminService.tdsDetails(formData).subscribe(
      (res : any) => { console.log(res);   this.tds = res; this.loading=false;},
      (err) => { console.log(err); this.msg.create('success','Error Occured at Server. Please try again.'); this.loading=false;}

       );
  }

}
<div nz-row class="container">
    <div nz-col nzSpan="24" style='text-align: center'>

TDS for Month :: <nz-date-picker nzMode="month" [(ngModel)]="date" (ngModelChange)="onChange()" readonly></nz-date-picker>

</div>

</div>

<div nz-row> &nbsp; </div>

<ng-container *ngIf="!loading && tds && tds.length > 0">
    <!-- <div nz-row >
        <div nz-col nzSpan="24" style='text-align: left'>

            <button nz-button nzType="primary" (click)='download()' [nzLoading]='downloading'>
                Download Excel
            </button>


        </div>
    </div>
     -->


    </ng-container>


    <div style='overflow:auto;width:100%;height:100%'>
    <nz-table #basicTable nzShowPagination=false nzBordered [nzData]="tds" [nzLoading]="loading">
        <thead>
            <tr>

                <th> # </th>

                <th> Customer Id </th>
                <th> Customer Name </th>
                <th> PAN </th>
                <th> Email </th>
                <th> Contact </th>
                <th> City </th>
                <th> TDS </th>


            </tr>
        </thead>

        <tbody>
        <tr *ngFor="let data of tds; index as i">

            <td>{{ (i+1) }}</td>
            <td>{{ data.parentId }}</td>
            <td>{{ data.name }}</td>
            <td>{{ data.pan }}</td>
            <td>{{ data.email }}</td>
            <td>{{ data.contact }}</td>
            <td>{{ data.city }}</td>
            <td>{{ data.tds }}</td>


        </tr>


    </tbody>
    </nz-table>
</div>
